import React from 'react';
import { Link } from 'react-router-dom'; 
import './Home.css';


function Home() {

  var __html = require('./html/index.html');
  var template = { __html: __html };
    
  React.module.exports = React.createClass({
    render: function() {
      return(
        <div dangerouslySetInnerHTML={template} />
      );
    }
  });
}

export default Home;
